        <div class=""section"" id=""day2"">
            <div class=""bgdark"">
                <h1>
                    Chobe National Park
                </h1>
                This morning you will visit the magnificent Victoria Falls, named by Dr David Livingstone in honour of his English queen. One of the world's true natural wonders, Victoria Falls form the largest sheet of falling water in the world, when in full flow. The group will enter the park as soon as the gates open to make the most of the early morning sun, which rises behind the falls and illuminates the vast plumes of spray that bellow from Bakoka Gorge. Your photographic guide will lead you to the best vantage points to capture the sunrise. During the morning you will be able to cover the falls from many different perspectives, ensuring you come away ");
                WriteLiteral(@"with a range of images of this spectacular waterfall. Your Africaconnect leader will also be available for those who wish to learn more about the falls and its detailed history.

                After your tour, follow the Zambezi River to Botswana and make your way to Chobe National Park (100km approximately 2–3 hours, not including border formalities). You will arrive at your lodge at around midday.

                In the afternoon, embark on a boat safari along the picturesque Chobe River, 5one of the photographic highlights of this trip and an ideal location for spotting bird life such as saddle-billed storks, malachite kingfishers, fish eagles and beautiful bee-eaters.Swimming elephants are a special sight on the Chobe River and these boats provide a unique vantage point. You will spend the night in a chalet located just outside Chobe National Park.

                <br />
                <br />
                <ul>
                    <li>
                        Accommodation:
             ");
