                    </li>
                    <li>
                        Meals included:
                        Breakfast,
                        Dinner
                    </li>
                </ul>

            </div>
        </div>

        <div class=""section"" id=""day3"">

            <div class=""bgdark"">
                <h1>Makgadikgadi Pans</h1>

                Rise early and perhaps spend some more time in the underground photography bunker. This extra time might allow you to capture an amazing photo or two of thirsty predators or antelope stopping for a morning drink.

                Heading south, you will continue your journey (410 kilometres, approximately 6 hours) to the Makgadikgadi Pans for an afternoon excursion. Witness the immensity of this sprawling salt flat, one of the largest in the worl");
                WriteLiteral(@"d. Later you will head to Gweta Lodge, located near the edge of the pans.

